// src/FindArtist.js
import React, { useState, useEffect } from 'react';
import './FindArtist.css'; // For styling

const FindArtist = () => {
  const [artists, setArtists] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Fetch artists data from an API or use mock data
  useEffect(() => {
    fetch('/api/artists') // Replace with your actual API endpoint
      .then((response) => response.json())
      .then((data) => {
        setArtists(data);
        setLoading(false);
      })
      .catch((err) => {
        setError('Failed to load artists');
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>{error}</div>;
  }

  return (
    <div className="artist-container">
      <h2>Find Artists</h2>
      <div className="artist-list">
        {artists.map((artist) => (
          <div key={artist.id} className="artist-card">
            <img src={artist.profilePicture} alt={artist.name} />
            <h3>{artist.name}</h3>
            <p>{artist.skills.join(', ')}</p>
            <p>{artist.location}</p>
            <button>View Profile</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default FindArtist;
